import { StyleSheet } from "react-native";

const StyleBlockUserCenter = StyleSheet.create({
    styleText:{
        marginLeft:"4%",
        marginBottom:"1%",
        marginTop:"2%"
    },

    blockedUsersCinteiner:{
        display:'flex',
        width:"95%",
        backgroundColor:'red',
        marginLeft:'5%'
    }

});

export default StyleBlockUserCenter;
